// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.24;

import 'hardhat/console.sol';

contract JobBoard {
  struct Job {
    address employer;
    string description;
    string qualifications;
    uint rewardPool;
    uint applicationCount;
    mapping(address => bool) applicants;
  }

  mapping(uint => Job) public jobs;
  uint public jobCount;

  event JobPosted(
    uint jobId,
    address indexed employer,
    string description,
    string qualifications,
    uint rewardPool
  );
  event JobApplied(address indexed applicant, uint indexed jobId);

  function postJob(
    string memory _description,
    string memory _qualifications,
    uint _rewardPool
  ) external {
    Job storage newJob = jobs[jobCount];
    newJob.employer = msg.sender;
    newJob.description = _description;
    newJob.qualifications = _qualifications;
    newJob.rewardPool = _rewardPool;
    newJob.applicationCount = 0;

    emit JobPosted(
      jobCount,
      msg.sender,
      _description,
      _qualifications,
      _rewardPool
    );
    jobCount++;
  }

  function applyForJob(uint _jobId) external {
    require(!jobs[_jobId].applicants[msg.sender], 'Already applied');
    jobs[_jobId].applicants[msg.sender] = true;
    jobs[_jobId].applicationCount++;
    emit JobApplied(msg.sender, _jobId);
  }
}

